Shapefiles should be coloured by default as per the [Extent  Layer Colours|^Extent  Layer Colours.xls] and Depth/Velocity rasters should be a choice between the 5 attached styles (letting the user change between them, similarly to how they can adjust the layers transparency).

Next to the layer transparency controls there should also be functionality to let the user switch between different colour schemes (choice of 5 ColorBrewer sets for example) for shapefiles and rasters.

\\
\\
{panel:title=User Feedback (!)|titleBGColor=lightblue}
Portal Beta Testing Feedback Summary - Chris Bloss - Item 9:

{quote}
"I noticed there was some inconsistency with how different maps were displayed.  The Tasmanian maps appeared different. "
the basics of map display should be consistent regardless of if the map was webservice sourced or uploaded through the data entry app. That is they should all have a legend with a title, consistent color scales and general structure (no thick outlines etc...)
{quote}

{panel}

Similarly to the Earthquakes Hazard:

http://www.ga.gov.au/darwin-view/hazards.xhtml#

Add a few Geoscience Australia Layers as shown in mock ups:

\\
{panel:title=User Feedback (!)|titleBGColor=lightblue}
U1 Additional Content and Functionality:

{quote}
Visual representation and topography: if I build a road, will it flood? (P5) 
{quote}

{panel}

(!) Ensure the default place the layer switcher pops up does not obscure the Map zoom functions and scale as it currently does.

Perhaps a cadastre layer as well?

\\
{panel:title=User Feedback (!)|titleBGColor=lightblue}
U1 Additional Content and Functionality:

{quote}
Add the cadastre  actual lines between properties (P11)
{quote}

{panel}

(!) Note the colour picker for the Shapefiles in the example; see NFRIP-139 for more details of these buttons dependant on resource type.

If a single flood study has many display resources, implement a scroll bar on the layer selector.

Implementing the ability to add Rasters (Depth, Velocity and Hazard) to the map as well as geo-referenced pdfs and images.

\\
{panel:title=User Feedback (!)|titleBGColor=lightblue}
U1 Additional content and functionality 3:

{quote}
Depth and velocity information. I was expecting maps of depth and velocity, whereas this is a description (P2)
{quote}

{panel}

{panel:title=Original}

Update GeoFabric to version 2.2.1. See email received by Laurie at D2014-202240.

We would like to keep up to date so our searches utilise the latest geometries from the BoM.

{panel}

Maree Wilson is working on an LGA Web Service that will be kept up to date (see email attached). 

Can we have this web service replace the existing one providing the LGA extents to the Portal.


{panel:title=Comment from Maree:|titleBGColor=lightblue}

{quote}
There are however web services published through data.gov.au from the PSMA data (which is the most current)  I would suggest that these are probably a better bet rather than recreating your own.  The one problem is that theyre published by state rather than with a single service with them all together.  Hopefully NFRIP can handle this?

Take a look at these for example, and if these are what youre after, the rest of the states are available too.  The WMS and WFS links are under the heading Data and Resources:
http://data.gov.au/dataset/nt-local-government-areas-psma-administrative-boundaries
http://data.gov.au/dataset/qld-local-government-areas-psma-administrative-boundaries
http://data.gov.au/dataset/nsw-local-government-areas
(search for local government areas on http://data.gov.au)

{quote}

{panel}
